                      text: 'We stock components from the industry-leading manufacturers and every item in our passive components range is available for fast and efficient delivery. Our selection of components aims to cater for all projects and applications. We have an extensive range of capacitors, including variable and trimmer versions, tantalum, power, interference, film and ceramic capacitors, along with polymer, and aluminium electrolytic capacitors. <br/><br/>Resistors are another component that are as vital to many devices as our high standards are to us. We understand the vital safety offered by resistors for both your equipment and you and will never compromise on the quality of the components that we supply.<br/><br/>Our ferrite range features everything from Cores RM to toroidal and dual aperture items, and we offer a full selection of filters including mains filters for 3 or 1 phase systems, dual mode filters, SMD common mode filters, and radial common mode versions. If you are in the market for inductors, look no further and start browsing our comprehensive collection of charging, toroidal, axial, radial, and SMD inductors.',
