                      text: 'At Distrelec, we are experts in the supply of passive components needed to have the necessary effect on the circuits in your devices but there is nothing passive about the service that we offer our customers, both old and new. We actively work to offer you the most comprehensive selection of passive components possible to ensure that we can always be your one-stop shop for all of your electrical needs.',
